import React from 'react';
import logo from '../logo.svg';
import '../App.css';
import BeginButton from '../components/BeginButton';

const Quiz = () => {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>
                This is Quiz
                </p>
                <Question></Question>
            </header>
        </div>
    )
}

export default Quiz
